\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D1%81%D1%82%D0%BE%D0%BB\" title=\"\u041f\u0440\u0435\u0441\u0442\u043e\u043b\">\u043f\u0440\u0435\u0441\u0442\u043e\u043b<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_VII_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D0%B8)\" title=\"\u041a\u0430\u0440\u043b VII (\u043a\u043e\u0440\u043e\u043b\u044c \u0424\u0440\u0430\u043d\u0446\u0438\u0438)\">\u041a\u0430\u0440\u043b VII<\/a> (\u0437\u043d\u0430\u043c\u044f \u043d\u0430\u0434 \u0435\u0433\u043e \u0433\u043e\u043b\u043e\u0432\u043e\u0439 \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0446\u0435\u0440\u0435\u043c\u043e\u043d\u0438\u0438 \u0434\u0435\u0440\u0436\u0430\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B0%D0%BD%D0%BD%D0%B0_%D0%B4%E2%80%99%D0%90%D1%80%D0%BA\" title=\"\u0416\u0430\u043d\u043d\u0430 \u0434\u2019\u0410\u0440\u043a\">\u0416\u0430\u043d\u043d\u0430 \u0434\u2019\u0410\u0440\u043a<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1453_%D0%B3%D0%BE%D0%B4\" title=\"1453 \u0433\u043e\u0434\">1453<\/a>&#160;\u2014 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u044b \u0440\u0430\u0437\u0431\u0438\u043b\u0438 \u0430\u043d\u0433\u043b\u0438\u0447\u0430\u043d \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%9A%D0%B0%D1%81%D1%82%D0%B8%D0%B9%D0%BE%D0%BD%D0%B5\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041a\u0430\u0441\u0442\u0438\u0439\u043e\u043d\u0435\">\u0431\u0438\u0442\u0432\u0435 \u043f\u0440\u0438 \u041a\u0430\u0441\u0442\u0438\u0439\u043e\u043d\u0435<\/a>, \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0435\u0439 \u0431\u0438\u0442\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%BE%D0%BB%D0%B5%D1%82%D0%BD%D1%8F%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0421\u0442\u043e\u043b\u0435\u0442\u043d\u044f\u044f \u0432\u043e\u0439\u043d\u0430\">\u0421\u0442