0435\u043d\u0438\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BB%D1%8C%D0%BD%D1%8E%D1%81\" title=\"\u0412\u0438\u043b\u044c\u043d\u044e\u0441\">\u0412\u0438\u043b\u044c\u043d\u043e<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B5%D0%B7%D1%83%D0%B8%D1%82%D1%8B\" title=\"\u0418\u0435\u0437\u0443\u0438\u0442\u044b\">\u0438\u0435\u0437\u0443\u0438\u0442\u0441\u043a\u043e\u0439<\/a> \u043a\u043e\u043b\u043b\u0435\u0433\u0438\u0438, \u0432\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u043f\u0440\u0435\u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u043d\u043e\u0439 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BB%D1%8C%D0%BD%D1%8E%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82\" title=\"\u0412\u0438\u043b\u044c\u043d\u044e\u0441\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\">\u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1710_%D0%B3%D0%BE%D0%B4\" title=\"1710 \u0433\u043e\u0434\">1710<\/a>&#160;\u2014 \u0421\u0434\u0430\u0447\u0430 \u0440\u0438\u0436\u0441\u043a\u043e\u0433\u043e \u0433\u0430\u0440\u043d\u0438\u0437\u043e\u043d\u0430 \u0440\u0443\u0441\u0441\u043a\u0438\u043c \u0432\u043e\u0439\u0441\u043a\u0430\u043c \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u0444\u0435\u043b\u044c\u0434\u043c\u0430\u0440\u0448\u0430\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B5%D1%80%D0%B5%D0%BC%D0%B5%D1%82%D0%B5%D0%B2,_%D0%91%D0%BE%D1%80%D0%B8%D1%81_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0428\u0435\u0440\u0435\u043c\u0435\u0442\u0435\u0432, \u0411\u043e\u0440\u0438\u0441 \u041f\u0435\u0442\u0440\u043e\u0432\u0438\u0447\">\u0428\u0435\u0440\u0435\u043c\u0435\u0442\u0435\u0432\u0430<\/a> \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1700%E2%80%941721)\" class=\"mw-redirect\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1700\u20141721)\">\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1754_%D0%B3%D0%BE%D0%B4\" title=\"1754 \u0433\u043e\u0434\">1754<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0441\u044f \u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0438\u0439 \u043a\u043e\u043b\u043b\u0435\u0434\u0436. \u0412 \u044d\u0442\u043e\u043c \u0432\u044b\u0441\u0448\u0435\u043c \u0443\u0447\u0435\u0431\u043d\u043e\u043c \u0437\u0430\u0432\u0435\u0434\u0435\u043d\u0438\u0438 \u0431\u044b\u043b\u043e \u0434\u0435\u0441\u044f\u0442\u044c \u0441\u0442\u0443\u0434\u0435\u043d\u0442\u043e\u0432 \u0438 \u043e\u0434\u0438\u043d \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u043e\u0440. \u0427\u0435\u0440\u0435\u0437 \u0442\u0440\u0438\u0434\u0446\u0430\u0442\u044c \u043b\u0435\u0442 \u043a\u043e\u043b\u043b\u0435\u0434\u0436 \u0441\u043c\u0435\u043d\u0438\u043b \u0441\u0432\u043e\u0451 \u0438\u043c\u044f \u043d\u0430 \u041a\u043e\u043b\u0443\u043c\u0431\u0438\u0439\u0441\u043a\u0438\u0439, \u0430 \u043f\u043e\u0442\u043e\u043c \u0441\u0442\u0430\u043b \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u043e\u043c. \u041d\u044b\u043d\u0435 \u044d\u0442\u043e \u043e\u0434\u0438\u043d \u0438\u0437 \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0438\u0445 \u0438 \u043f\u0440\u0435\u0441\u0442\u0438\u0436\u043d\u0435\u0439\u0448\u0438\u0445 \u0432\u0443\u0437\u043e\u0432 \u0410\u043c\u0435\u0440\u0438\u043a\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1775_%D0%B3%D0%BE%D0%B4\" title=\"1775 \u0433\u043e\u0434\">1775<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a> \u043e\u0442\u043a\u0440\u044b\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u043c\u0438\u0440\u0435 \u0432\u043e\u0435\u043d\u043d\u044b\u0439 \u0433\u043e\u0441\u043f\u0438\u0442\u0430\u043b\u044c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1783_%D0%B3%D0%BE%D0%B4\" title=\"1783 \u0433\u043e\u0434\">1783<\/a>&#160;\u2014 \u0443\u0442\u0432\u0435\u0440\u0436\u0434\u0451\u043d \u0433\u0435\u0440\u0431 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%BC%D1%8C\" title=\"\u041f\u0435\u0440\u043c\u044c\">\u041f\u0435\u0440\u043c\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1785_%D0%B3%D0%BE%D0%B4\" title=\"1785 \u0433\u043e\u0434\">1785<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BB%D0%BE%D0%B2%D0%B0%D0%BA%D0%B8%D1%8F\" title=\"\u0421\u043b\u043e\u0432\u0430\u043a\u0438\u044f\">\u0441\u043b\u043e\u0432\u0430\u0446\u043a\u0438\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D0%B0%D0%BD%D1%82%D1%8E%D1%80%D0%B0\" title=\"\u0410\u0432\u0430\u043d\u0442\u044e\u0440\u0430\">\u0430\u0432\u0430\u043d\u0442\u044e\u0440\u0438\u0441\u0442<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BD%D1%91%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%9C%D0%BE%D1%80%D0%B8%D1%86_%D0%90%D0%B2%D0%B3%D1%83%D1%81%D1%82\" title=\"\u0411\u0435\u043d\u0451\u0432\u0441\u043a\u0438\u0439, \u041c\u043e\u0440\u0438\u0446 \u0410\u0432\u0433\u0443\u0441\u0442\">\u041c\u043e\u0440\u0438\u0