\u043a\u0430\u044f \u0436\u0435\u043b\u0435\u0437\u043d\u0430\u044f \u0434\u043e\u0440\u043e\u0433\u0430\">\u043f\u0435\u0440\u0432\u0430\u044f \u0432 \u0415\u0432\u0440\u043e\u043f\u0435 \u0433\u043e\u0440\u043d\u0430\u044f \u0436\u0435\u043b\u0435\u0437\u043d\u0430\u044f \u0434\u043e\u0440\u043e\u0433\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1868_%D0%B3%D0%BE%D0%B4\" title=\"1868 \u0433\u043e\u0434\">1868<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u044f\u043f\u043e\u043d\u0441\u043a\u0430\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%BE%D0%BB%D0%B8%D1%86%D0%B0\" title=\"\u0421\u0442\u043e\u043b\u0438\u0446\u0430\">\u0441\u0442\u043e\u043b\u0438\u0446\u0430<\/a> \u043f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u0430 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%BE%D1%82%D0%BE\" title=\"\u041a\u0438\u043e\u0442\u043e\">\u041a\u0438\u043e\u0442\u043e<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%BA%D0%B8%D0%BE\" title=\"\u0422\u043e\u043a\u0438\u043e\">\u0422\u043e\u043a\u0438\u043e<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1902_%D0%B3%D0%BE%D0%B4\" title=\"1902 \u0433\u043e\u0434\">1902<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%8D%D1%80%D1%80%D0%B8%D0%B5%D1%80,_%D0%A3%D0%B8%D0%BB%D0%BB%D0%B8%D1%81\" title=\"\u041a\u044d\u0440\u0440\u0438\u0435\u0440, \u0423\u0438\u043b\u043b\u0438\u0441\">\u0423\u0438\u043b\u043b\u0438\u0441\u043e\u043c \u041a\u044d\u0440\u0440\u0438\u0435\u0440\u043e\u043c<\/a> \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0435\u043d \u043f\u0440\u043e\u0435\u043a\u0442 \u043f\u0435\u0440\u0432\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D0%B4%D0%B8%D1%86%D0%B8%D0%BE%D0%BD%D0%B5%D1%80\" title=\"\u041a\u043e\u043d\u0434\u0438\u0446\u0438\u043e\u043d\u0435\u0440\">\u043a\u043e\u043d\u0434\u0438\u0446\u0438\u043e\u043d\u0435\u0440\u0430<\/a> \u0432\u043e\u0437\u0434\u0443\u0445\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1907_%D0%B3%D0%BE%D0%B4\" title=\"1907 \u0433\u043e\u0434\">1907<\/a>&#160;\u2014 \u0420\u0443\u0441\u0441\u043a\u043e-\u044f\u043f\u043e\u043d\u0441\u043a\u043e\u0435 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a>. \u0421\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u0441\u043e\u0434\u0435\u0440\u0436\u0430\u043b\u043e \u0432 \u0441\u0435\u0431\u0435 \u0441\u0442\u0430\u0442\u044c\u0438 \u043e\u0431 \u0443\u0432\u0430\u0436\u0435\u043d\u0438\u0438 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0430\u043b\u044c\u043d\u043e\u0439 \u0446\u0435\u043b\u043e\u0441\u0442\u043d\u043e\u0441\u0442\u0438 \u0441\u0442\u043e\u0440\u043e\u043d, \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 \u0438 \u0446\u0435\u043b\u043e\u0441\u0442\u043d\u043e\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9\" class=\"mw-redirect\" title=\"\u041a\u0438\u0442\u0430\u0439\">\u041a\u0438\u0442\u0430\u044f<\/a>, \u043e \u0440\u0430\u0437\u0434\u0435\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BD%D1%8C%D1%87%D0%B6%D1%83%D1%80%D0%B8%D1%8F\" title=\"\u041c\u0430\u043d\u044c\u0447\u0436\u0443\u0440\u0438\u044f\">\u041c\u0430\u043d\u0447\u0436\u0443\u0440\u0438\u0438<\/a> \u043d\u0430 \u0440\u0443\u0441\u0441\u043a\u0443\u044e (\u0441\u0435\u0432\u0435\u0440) \u0438 \u044f\u043f\u043e\u043d\u0441\u043a\u0443\u044e (\u044e\u0433) \u0441\u0444\u0435\u0440\u044b \u0432\u043b\u0438\u044f\u043d\u0438\u044f, \u043e \u043f\u0440\u0438\u0437\u043d\u0430\u043d\u0438\u0438 \u041a\u043e\u0440\u0435\u0438 \u0441\u0444\u0435\u0440\u043e\u0439 \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0445 \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u0438<\/a>, \u0412\u043d\u0435\u0448\u043d\u0435\u0439 \u041c\u043e\u043d\u0433\u043e\u043b\u0438\u0438&#160;\u2014 \u0420\u043e\u0441\u0441\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1911_%D0%B3%D0%BE%D0%B4\" title=\"1911 \u0433\u043e\u0434\">1911<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u044b\u0439 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u0430\u0432\u0442\u043e\u043f\u0440\u043e\u0431\u0435\u0433 \u0432\u043e\u0435\u043d\u043d\u044b\u0445 \u0433\u0440\u0443\u0437\u043e\u0432\u0438\u043a\u043e\u0432 \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" class=\"mw-redirect\" title=\"\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u043e\u043c<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u043e\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1915_%D0%B3%D0%BE%D0%B4\" title=\"1915 \u0433\u043e\u0434\">1915<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0438\u044f<\/a> \u0437\u0430\u043a\u043b\u044e\u0447\u0438\u043b\u0438 \u0441\u0435\u043a\u0440\u0435\u0442\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u043e \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u0435 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D0%B3%D0%B0%D1%80%D0%B8%D1%8F\" title=\"\u0411\u043e\u043b\u0433\u0430\u0440\u0438\u044f\">\u0411\u043e\u043b\u0433\u0430\u0440\u0438\u0435\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B8%D1%82%D1%83%D0%BB\" title=\"\u0422\u0438\u0442\u0443\u043b\">\u0442\u0438\u0442\u0443\u043b\u043e\u0432<\/a> \u0438\u0437\u044a\u044f\u0442\u044b \u0432\u0441\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0435<\/a> \u0438\u043c\u0435\u043d\u0430, \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0447\u0435\u0433\u043e \u043f\u0440\u0430\u0432\u044f\u0449\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BA%D1%81%D0%B5%D0%BD-%D0%9A%D0%BE%D0%B1%D1%83%D1%80%D0%B3-%D0%93%D0%BE%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%B4%D0%B8%D0%BD%D0%B0%D1%81%D1%82%D0%B8%D1%8F\" title=\"\u0421\u0430\u043a\u0441\u0435\u043d-\u041a\u043e\u0431\u0443\u0440\u0433-\u0413\u043e\u0442\u0441\u043a\u0430\u044f \u0434\u0438\u043d\u0430\u0441\u0442\u0438\u044f\">\u0421\u0430\u043a\u0441\u0435\u043d-\u041a\u043e\u0431\u0443\u0440\u0433-\u0413\u043e\u0442\u0441\u043a\u0430\u044f \u0434\u0438\u043d\u0430\u0441\u0442\u0438\u044f<\/a> \u0441\u0442\u0430\u043b\u0430 \u043d\u0430\u0437\u044b\u0432\u0430\u0442\u044c\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BD%D0%B4%D0%B7%D0%BE%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%B4%D0%B8%D0%BD%D0%B0%D1%81%D1%82%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u0412\u0438\u043d\u0434\u0437\u043e\u0440\u0441\u043a\u0430\u044f \u0434\u0438\u043d\u0430\u0441\u0442\u0438\u044f\">\u0412\u0438\u043d\u0434\u0437\u043e\u0440\u0441\u043a\u043e\u0439<\/a>.<\/li><li>1917&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0440\u043e\u0433\u0440\u0430\u0434\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%8E%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B5_%D0%B4%D0%BD%D0%B8\" title=\"\u0418\u044e\u043b\u044c\u0441\u043a\u0438\u0435 \u0434\u043d\u0438\">\u0440\u0430\u0441\u0441\u0442\u0440\u0435\u043b\u044f\u043d\u0430 \u043c\u0438\u0440\u043d\u0430\u044f \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%BE%D0%BB%D0%B5%D1%82%D0%B0%D1%80%D0%B8%D0%B0%D1%82\" title=\"\u041f\u0440\u043e\u043b\u0435\u0442\u0430\u0440\u0438\u0430\u0442\">\u0440\u0430\u0431\u043e\u0447\u0438\u0445<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%BB%D0%B4%D0%B0%D1%82\" title=\"\u0421\u043e\u043b\u0434\u0430\u0442\">\u0441\u043e\u043b\u0434\u0430\u0442<\/a>.<\/li><li>1917&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BB%D0%B5%D1%85%D0%B0%D0%BD%D0%BE%D0%B2,_%D0%93%D0%B5%D0%BE%D1%80%D0%B3%D0%B8%D0%B9_%D0%92%D0%B0%D0%BB%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041f\u043b\u0435\u0445\u0430\u043d\u043e\u0432, \u0413\u0435\u043e\u0440\u0433\u0438\u0439 \u0412\u0430\u043b\u0435\u043d\u0442\u0438\u043d\u043e\u0432\u0438\u0447\">\u043f\u043b\u0435\u0445\u0430\u043d\u043e\u0432\u0441\u043a\u043e\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B7%D0%B5%D1%82%D0%B0\" title=\"\u0413\u0430\u0437\u0435\u0442\u0430\">\u0433\u0430\u0437\u0435\u0442\u0435<\/a> \u00ab\u0415\u0434\u0438\u043d\u0441\u0442\u0432\u043e\u00bb \u0440\u0443\u0441\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D1%83%D1%80%D0%BD%D0%B0%D0%BB%D0%B8%D1%81%D1%82\" title=\"\u0416\u0443\u0440\u043d\u0430\u043b\u0438\u0441\u0442\">\u0436\u0443\u0440\u043d\u0430\u043b\u0438\u0441\u0442<\/a> \u0413. \u0410\u043b\u0435\u043a\u0441\u0438\u043d\u0441\u043a\u0438\u0439 \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043b \u0441\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u043e \u0442\u043e\u043c, \u0447\u0442\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%98%D0%BB%D1%8C%D0%B8%D1%87\" title=\"\u041b\u0435\u043d\u0438\u043d, \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0418\u043b\u044c\u0438\u0447\">\u041b\u0435\u043d\u0438\u043d<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%B5%D0%B2%D0%B8%D0%BA\" class=\"mw-redirect\" title=\"\u0411\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u043a\">\u0431\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u043a\u0438<\/a> \u0444\u0438\u043d\u0430\u043d\u0441\u0438\u0440\u0443\u044e\u0442\u0441\u044f \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u043c \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\u043c.<\/li><li>1917&#160;\u2014 \u041a\u043e\u043c\u0430\u043d\u0434\u0443\u044e\u0449\u0438\u0439 \u0411\u0430\u043b\u0442\u0444\u043b\u043e\u0442\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B4%D0%BC%D0%B8%D1%80%D0%B0%D0%BB\" title=\"\u0410\u0434\u043c\u0438\u0440\u0430\u043b\">\u0430\u0434\u043c\u0438\u0440\u0430\u043b<\/a> \u0414. \u0412\u0435\u0440\u0434\u0435\u0440\u0435\u0432\u0441\u043a\u0438\u0439 \u043e\u0442\u043a\u0430\u0437\u0430\u043b\u0441\u044f \u0438\u0441\u043f\u043e\u043b\u043d\u044f\u0442\u044c \u043f\u0440\u0438\u043a\u0430\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%80%D0%B5%D0%BC%D0%B5%D0%BD%D0%BD%D0%BE%D0%B5_%D0%BF%D1%80%D0%B0%D0%B2%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%BE_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u0412\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0420\u043e\u0441\u0441\u0438\u0438\">\u0412\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430<\/a> \u043e\u0442\u043f\u0440\u0430\u0432\u0438\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%B0%D0%B1%D0%BB%D1%8C\" title=\"\u041a\u043e\u0440\u0430\u0431\u043b\u044c\">\u043a\u043e\u0440\u0430\u0431\u043b\u0438<\/a> \u043f\u0440\u043e\u0442\u0438\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%BE%D0%BD%D1%88%D1%82%D0%B0%D0%B4%D1%82\" title=\"\u041a\u0440\u043e\u043d\u0448\u0442\u0430\u0434\u0442\">\u043a\u0440\u043e\u043d\u0448\u0442\u0430\u0434\u0442\u0441\u043a\u0438\u0445<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%80%D1%8F%D0%BA\" title=\"\u041c\u043e\u0440\u044f\u043a\">\u043c\u043e\u0440\u044f\u043a\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u041f\u0440\u043e\u0442\u044f\u0436\u0451\u043d\u043d\u043e\u0441\u0442\u044c \u0417\u0430\u043f\u0430\u0434\u043d\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%BE%D0%BD%D1%82_(%D0%B2%D0%BE%D0%B9%D1%81%D0%BA%D0%BE%D0%B2%D0%BE%D0%B5_%D0%BE%D0%B1%D1%8A%D0%B5%D0%B4%D0%B8%D0%BD%D0%B5%D0%BD%D0%B8%D0%B5)\" title=\"\u0424\u0440\u043e\u043d\u0442 (\u0432\u043e\u0439\u0441\u043a\u043e\u0432\u043e\u0435 \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0435)\">\u0444\u0440\u043e\u043d\u0442\u0430<\/a> \u0434\u043e\u0441\u0442\u0438\u0433\u043b\u0430 \u0440\u0435\u043a\u043e\u0440\u0434\u043d\u043e\u0439 \u0434\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041f\u0435\u0440\u0432\u043e\u0439 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> \u0434\u043b\u0438\u043d\u044b&#160;\u2014 856&#160;\u043a\u043c.<\/li><li>1918&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b\u0438, \u0447\u0442\u043e \u043e\u0441\u043d\u043e\u0432\u043d\u044b\u043c \u043f\u0440\u0438\u043d\u0446\u0438\u043f\u043e\u043c \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u0438\u043d\u0442\u0435\u0440\u0432\u0435\u043d\u0446\u0438\u0438 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D0%92%D0%BE%D1%81%D1%82%D0%BE%D0%BA_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u0414\u0430\u043b\u044c\u043d\u0438\u0439 \u0412\u043e\u0441\u0442\u043e\u043a \u0420\u043e\u0441\u0441\u0438\u0438\">\u0414\u0430\u043b\u044c\u043d\u0435\u043c \u0412\u043e\u0441\u0442\u043e\u043a\u0435<\/a> \u0431\u0443\u0434\u0435\u0442 \u043d\u0435\u0432\u043c\u0435\u0448\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0432 \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u0441\u043e\u0431\u044b\u0442\u0438\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u041d\u043e\u0447\u044c\u044e, \u0432 \u043f\u043e\u0434\u0432\u0430\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D0%BC_%D0%98%D0%BF%D0%B0%D1%82%D1%8C%D0%B5%D0%B2%D0%B0\" title=\"\u0414\u043e\u043c \u0418\u043f\u0430\u0442\u044c\u0435\u0432\u0430\">\u0418\u043f\u0430\u0442\u044c\u0435\u0432\u0441\u043a\u043e\u0433\u043e \u0434\u043e\u043c\u0430<\/a>, \u0431\u044b\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D1%81%D1%81%D1%82%D1%80%D0%B5%D0%BB_%D1%86%D0%B0%D1%80%D1%81%D0%BA%D0%BE%D0%B9_%D1%81%D0%B5%D0%BC%D1%8C%D0%B8\" title=\"\u0420\u0430\u0441\u0441\u0442\u0440\u0435\u043b \u0446\u0430\u0440\u0441\u043a\u043e\u0439 \u0441\u0435\u043c\u044c\u0438\">\u0440\u0430\u0441\u0441\u0442\u0440\u0435\u043b\u044f\u043d\u0430<\/a> \u0441\u0435\u043c\u044c\u044f \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0435\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80_%D0%92%D1%81%D0%B5%D1%80%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9\" title=\"\u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439\">\u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 \u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0433\u043e<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_II\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 II\">\u041d\u0438\u043a\u043e\u043b\u0430\u044f II<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%B1%D0%B8%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u0421\u0438\u0431\u0438\u0440\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0421\u0438\u0431\u0438\u0440\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430<\/a>.<\/li><li>1918&#160;\u2014 \u0421\u041d\u041a \u043f\u0440\u0438\u043d\u044f\u043b \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u00ab\u041e \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043a\u0435 \u0432 \u041c\u043e\u0441\u043a\u0432\u0435 \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a\u043e\u0432 \u0432\u0435\u043b\u0438\u043a\u0438\u043c \u043b\u044e\u0434\u044f\u043c\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a>&#160;\u2014 \u043a\u043e\u043d\u0435\u0446 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%BE-%D1%83%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041f\u043e\u043b\u044c\u0441\u043a\u043e-\u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u043f\u043e\u043b\u044c\u0441\u043a\u043e-\u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1923_%D0%B3%D0%BE%D0%B4\" title=\"1923 \u0433\u043e\u0434\">1923<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D1%85_%D0%9A%D0%BE%D0%BC%D0%B8%D1%81%D1%81%D0%B0%D1%80%D0%BE%D0%B2_%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u043e\u0432\u0435\u0442 \u041d\u0430\u0440\u043e\u0434\u043d\u044b\u0445 \u041a\u043e\u043