a.org\/wiki\/%D0%9A%D0%B8%D0%B5%D0%B2\" title=\"\u041a\u0438\u0435\u0432\">\u041a\u0438\u0435\u0432<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B5%D1%80%D1%81%D0%BE%D0%BD\" title=\"\u0425\u0435\u0440\u0441\u043e\u043d\">\u0425\u0435\u0440\u0441\u043e\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1936_%D0%B3%D0%BE%D0%B4\" title=\"1936 \u0433\u043e\u0434\">1936<\/a>&#160;\u2014 \u0421 \u043c\u044f\u0442\u0435\u0436\u0430 \u0432\u043e\u0435\u043d\u043d\u044b\u0445 \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2_%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D0%B8\" title=\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0418\u0441\u043f\u0430\u043d\u0438\u0438\">\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0418\u0441\u043f\u0430\u043d\u0438\u0438<\/a><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1938_%D0%B3%D0%BE%D0%B4\" title=\"1938 \u0433\u043e\u0434\">1938<\/a>&#160;\u2014 \u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0430\u0432\u0438\u0430\u043c\u0435\u0445\u0430\u043d\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9A%D0%BE%D1%80%D1%80%D0%B8%D0%B3%D0%B0%D0%BD,_%D0%94%D1%83%D0%B3%D0%BB%D0%B0%D1%81&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041a\u043e\u0440\u0440\u0438\u0433\u0430\u043d, \u0414\u0443\u0433\u043b\u0430\u0441 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0414\u0443\u0433\u043b\u0430\u0441 \u041a\u043e\u0440\u0440\u0438\u0433\u0430\u043d<\/a> (Douglas Corrigan) \u043f\u043e \u043e\u0448\u0438\u0431\u043a\u0435 (\u0438\u0437-\u0437\u0430 \u0442\u043e\u0433\u043e, \u0447\u0442\u043e \u043f\u0435\u0440\u04