440\u0430\u0438\u043d\u044b<\/a> \u043f\u0440\u0438\u043d\u044f\u043b \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u043e \u0441\u043e\u043a\u0440\u0430\u0449\u0435\u043d\u0438\u0438 \u0432\u043e\u0441\u044c\u043c\u0438 \u0438\u0437 \u0441\u043e\u0440\u043e\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D0%B0%D1%81%D1%82%D1%8B%D1%80%D1%8C\" title=\"\u041c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044c\">\u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u0435\u0439<\/a> \u0432 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1962_%D0%B3%D0%BE%D0%B4\" title=\"1962 \u0433\u043e\u0434\">1962<\/a>&#160;\u2014 \u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0441\u0430\u043c\u043e\u043b\u0451\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/North_American_X-15\" title=\"North American X-15\">X-15<\/a>, \u043f\u0438\u043b\u043e\u0442\u0438\u0440\u0443\u0435\u043c\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%B0%D0%B9%D1%82,_%D0%A0%D0%BE%D0%B1%D0%B5%D1%80%D1%82_%D0%9C%D0%B0%D0%B9%D0%BA%D0%BB\" title=\"\u0423\u0430\u0439\u0442, \u0420\u043e\u0431\u0435\u0440\u0442 \u041c\u0430\u0439\u043a\u043b\">\u0420\u043e\u0431\u0435\u0440\u0442\u043e\u043c \u0423\u0430\u0439\u0442\u043e\u043c<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u0435\u0440\u0435\u0441\u0451\u043a \u0433\u0440\u0430\u043d\u0438\u0446\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%81%D0%B5%D0%BB%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F\" title=\"\u0412\u0441\u0435\u043b\u0435\u043d\u043d\u0430\u044f\">\u043a\u043e\u0441\u043c\u043e\u0441\u0430<\/a> (50 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BB%D1%8F\" title=\"\u041c\u0438\u043b\u044f\">\u043c\u0438\u043b\u044c<\/a> \u0441\u043e\u0433\u043b\u0430\u0441\u043d\u043e \u043a\u043b\u0430\u0441\u0441\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE-%D0%B2%D0%BE%D0%B7%D0%B4%D1%83%D1%88%D0%BD%D1%8B%D0%B5_%D1%81%D0%B8%D0%BB%D1%8B_%D0%A1%D0%A8%D0%90\" title=\"\u0412\u043e\u0435\u043d\u043d\u043e-\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0435 \u0441\u0438\u043b\u044b \u0421\u0428\u0410\">\u0412\u043e\u0435\u043d\u043d\u043e-\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0445 \u0441\u0438\u043b \u0421\u0428\u0410<\/a>).<\/li><li>1962&#160;\u2014 \u0412 6 \u0447\u0430\u0441\u043e\u0432 50 \u043c\u0438\u043d\u0443\u0442 \u0430\u0442\u043e\u043c\u043d\u0430\u044f \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u0430\u044f \u043b\u043e\u0434\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%BE%D0%BC%D1%81%D0%BE%D0%BC%D0%BE%D0%BB_(%D0%90%D0%9F%D0%9B)\" class=\"mw-redirect\" title=\"\u041b\u0435\u043d\u0438\u043d\u0441\u043a\u0438\u0439 \u043a\u043e\u043c\u0441\u043e\u043c\u043e\u043b (\u0410\u041f\u041b)\">\u00ab\u041b\u0435\u043d\u0438\u043d\u0441\u043a\u0438\u0439 \u043a\u043e\u043c\u0441\u043e\u043c\u043e\u043b\u00bb<\/a> \u0434\u043e\u0441\u0442\u0438\u0433\u043b\u0430 \u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0433\u043e \u043f\u043e\u043b\u044e\u0441\u0430 \u0417\u0435\u043c\u043b\u0438. \u041f\u043e\u0441\u043b\u0435 \u0432\u043e\u0437\u0432\u0440\u0430\u0449\u0435\u043d\u0438\u044f \u043b\u043e\u0434\u043a\u0443 \u043d\u0430 \u043f\u0438\u0440\u0441\u0435 \u0432\u0441\u0442\u0440\u0435\u0447\u0430\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D1%80%D1%83%D1%89%D1%91%D0%B2,_%D0%9D%D0%B8%D0%BA%D0%B8%D1%82%D0%B0_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0425\u0440\u0443\u0449\u0451\u0432, \u041d\u0438\u043a\u0438\u0442\u0430 \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u041d.&#160;\u0421.&#160;\u0425\u0440\u0443\u0449\u0451\u0432<\/a> \u0438 \u043c\u0438\u043d\u0438\u0441\u0442\u0440 \u043e\u0431\u043e\u0440\u043e\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BB%D0%B8%D0%BD%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%A0%D0%BE%D0%B4%D0%B8%D0%BE%D0%BD_%D0%AF%D0%BA%D0%BE%D0%B2%D0%BB%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0430\u043b\u0438\u043d\u043e\u0432\u0441\u043a\u0438\u0439, \u0420\u043e\u0434\u0438\u043e\u043d \u042f\u043a\u043e\u0432\u043b\u0435\u0432\u0438\u0447\">\u0420.&#160;\u042f.&#160;\u041c\u0430\u043b\u0438\u043d\u043e\u0432\u0441\u043a\u0438\u0439<\/a>. \u041a\u0430\u043a \u0442\u043e\u043b\u044c\u043a\u043e \u044d\u043a\u0438\u043f\u0430\u0436 \u0441\u043e\u0448\u0451\u043b \u043d\u0430 \u0431\u0435\u0440\u0435\u0433, \u0441\u0440\u0430\u0437\u0443 \u0436\u0435 \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u043d\u0430\u0433\u0440\u0430\u0436\u0434\u0435\u043d\u0438\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1968_%D0%B3%D0%BE%D0%B4\" title=\"1968 \u0433\u043e\u0434\">1968<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u043f\u0440\u043e\u0448\u043b\u0430 \u043f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u043f\u043e\u043b\u043d\u043e\u043c\u0435\u0442\u0440\u0430\u0436\u043d\u043e\u0433\u043e \u043c\u0443\u043b\u044c\u0442\u0438\u043f\u043b\u0438\u043a\u0430\u0446\u0438\u043e\u043d\u043d\u043e\u0433\u043e \u0444\u0438\u043b\u044c\u043c\u0430 \u00ab\u0411\u0438\u0442\u043b\u0437\u00bb \u00ab\u0416\u0451\u043b\u0442\u0430\u044f \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u0430\u044f \u043b\u043e\u0434\u043a\u0430\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1968_%D0%B3%D0%BE%D0%B4\" title=\"1968 \u0433\u043e\u0434\">1968<\/a>&#160;\u2014 \u0412 \u0445\u043e\u0434\u0435 \u043f\u0435\u0440\u0435\u0432\u043e\u0440\u043e\u0442\u0430 (\u0432 1968\u20142003&#160;\u0433\u0433. \u043d\u0430\u0437\u044b\u0432\u0430\u043b\u0430\u0441\u044c \u0418\u044e\u043b\u044c\u0441\u043a\u043e\u0439 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u0435\u0439) \u043a \u0432\u043b\u0430\u0441\u0442\u0438 \u0432 \u0418\u0440\u0430\u043a\u0435 \u043f\u0440\u0438\u0448\u043b\u0430 \u043f\u0430\u0440\u0442\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B0%D1%81\" title=\"\u0411\u0430\u0430\u0441\">\u0411\u0430\u0430\u0441<\/a>. \u041d\u0430 \u044d\u0442\u043e\u0442 \u0440\u0430\u0437 \u043f\u0430\u0440\u0442\u0438\u044f \u0411\u0430\u0430\u0441 \u043f\u0440\u0430\u0432\u0438\u043b\u0430 \u0418\u0440\u0430\u043a\u043e\u043c \u0434\u043e 2003 \u0433\u043e\u0434\u0430<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1972_%D0%B3%D0%BE%D0%B4\" title=\"1972 \u0433\u043e\u0434\">1972<\/a>:<ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B0%D0%B3%D0%B0\" title=\"\u041f\u0440\u0430\u0433\u0430\">\u041f\u0440\u0430\u0433\u0435<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%BD%D0%BE\" title=\"\u0411\u0440\u043d\u043e\">\u0411\u0440\u043d\u043e<\/a> \u043f\u0440\u043e\u0448\u043b\u0438 \u0441\u0443\u0434\u0435\u0431\u043d\u044b\u0435 \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u044b \u043d\u0430\u0434 \u0447\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u0446\u043a\u0438\u043c\u0438 \u0434\u0438\u0441\u0441\u0438\u0434\u0435\u043d\u0442\u0430\u043c\u0438 (\u0434\u043e 11 \u0430\u0432\u0433\u0443\u0441\u0442\u0430).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%81%D0%B0%D0%B4%D0%BA%D0%B0_%D0%A2%D1%83-134_%D0%BD%D0%B0_%D0%98%D0%BA%D1%88%D0%B8%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D0%B2%D0%BE%D0%B4%D0%BE%D1%85%D1%80%D0%B0%D0%BD%D0%B8%D0%BB%D0%B8%D1%89%D0%B5\" title=\"\u041f\u043e\u0441\u0430\u0434\u043a\u0430 \u0422\u0443-134 \u043d\u0430 \u0418\u043a\u0448\u0438\u043d\u0441\u043a\u043e\u0435 \u0432\u043e\u0434\u043e\u0445\u0440\u0430\u043d\u0438\u043b\u0438\u0449\u0435\">\u041f\u043e\u0441\u0430\u0434\u043a\u0430 \u0422\u0443-134 \u043d\u0430 \u0418\u043a\u0448\u0438\u043d\u0441\u043a\u043e\u0435 \u0432\