">\u041f\u0435\u0442\u0440\u043e\u043f\u0430\u0432\u043b\u043e\u0432\u0441\u043a\u043e\u043c \u0441\u043e\u0431\u043e\u0440\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" class=\"mw-redirect\" title=\"\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0430<\/a> \u0437\u0430\u0445\u043e\u0440\u043e\u043d\u0435\u043d\u044b \u043e\u0441\u0442\u0430\u043d\u043a\u0438, \u043f\u0440\u0438\u0437\u043d\u0430\u043d\u043d\u044b\u0435 \u043e\u0441\u0442\u0430\u043d\u043a\u0430\u043c\u0438 \u0441\u0435\u043c\u044c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_II\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 II\">\u041d\u0438\u043a\u043e\u043b\u0430\u044f II<\/a>, \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0435\u0433\u043e \u0440\u0443\u0441\u0441\u043a\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80\" title=\"\u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\">\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430<\/a>.<\/li><\/ul><h3>XXI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2002_%D0%B3%D0%BE%D0%B4\" title=\"2002 \u0433\u043e\u0434\">2002<\/a>&#160;\u2014 \u0422\u0438\u043c\u0438\u0440\u044f\u0437\u0435\u0432\u0441\u043a\u0438\u0439 \u043c\u0435\u0436\u043c\u0443\u043d\u0438\u0446\u0438\u043f\u0430\u043b\u044c\u043d\u044b\u0439 \u0441\u0443\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u044b<\/a> \u0432\u044b\u043d\u0435\u0441 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u043e \u043f\u0440\u0435\u043a\u0440\u0430\u0449\u0435\u043d\u0438\u0438 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0433\u0430\u0437\u0435\u0442\u044b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%B8%D0%B5_%D0%B2%D0%B5%D0%B4%D0%BE%D0%BC%D0%BE%D1%81%D1%82%D0%B8\" title=\"\u0420\u0443\u0441\u0441\u043a\u0438\u0435 \u0432\u0435\u0434\u043e\u043c\u043e\u0441\u0442\u0438\">\u0420\u0443\u0441\u0441\u043a\u0438\u0435 \u0432\u0435\u0434\u043e\u043c\u043e\u0441\u0442\u0438<\/a>\u00bb \u0437\u0430 \u0440\u0430\u0437\u0436\u0438\u0433\u0430\u043d\u0438\u0435 \u043c\u0435\u0436\u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0439 \u0440\u043e\u0437\u043d\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2002_%D0%B3%D0%BE%D0%B4\" title=\"2002 \u0433\u043e\u0434\">2002<\/a>&#160;\u2014 \u041a\u043e\u043c\u043f\u0430\u043d\u0438\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Motorola\" title=\"Motorola\">Motorola<\/a>\u00bb \u043e\u0431\u044a\u044f\u0432\u0438\u043b\u0430 \u043e \u0440\u0435\u043a\u043e\u0440\u0434\u043d\u044b\u0445 \u0443\u0431\u044b\u0442\u043a\u0430\u0445 \u0432 \u0440\u0430\u0437\u043c\u0435\u0440\u0435 2,3&#160;\u043c\u043b\u0440\u0434 \u0434\u043e\u043b\u043b \u043f\u043e \u0438\u0442\u043e\u0433\u0430\u043c II \u043a\u0432\u0430\u0440\u0442\u0430\u043b\u0430 \u0442\u0435\u043a\u0443\u0449\u0435\u0433\u043e \u0433\u043e\u0434\u0430. \u0420\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442 \u0432\u044b\u0437\u0432\u0430\u043d \u0440\u0430\u0441\u0445\u043e\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c 3,4&#160;\u043c\u043b\u0440\u0434 \u0434\u043e\u043b\u043b. \u043d\u0430 \u0440\u0435\u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440\u0438\u0437\u0430\u0446\u0438\u044e \u043f\u043e\u0434\u0440\u0430\u0437\u0434\u0435\u043b\u0435\u043d\u0438\u044f \u043f\u043e \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0441\u0442\u0432\u0443 \u043a\u043e\u043c\u043f\u044c\u044e\u0442\u0435\u0440\u043d\u044b\u0445 \u0447\u0438\u043f\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2002_%D0%B3%D0%BE%D0%B4\" title=\"2002 \u0433\u043e\u0434\">2002<\/a>&#160;\u2014 \u041a\u043e\u043c\u043f\u0430\u043d\u0438\u044f \u00abDeutsche Telekom\u00bb (DTEGn.DE) (DT), \u0431\u044b\u0432\u0448\u0438\u0439 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u043c\u043e\u043d\u043e\u043f\u043e\u043b\u0438\u0441\u0442 \u0442\u0435\u043b\u0435\u043a\u043e\u043c\u043c\u0443\u043d\u0438\u043a\u0430\u0446\u0438\u043e\u043d\u043d\u043e\u0433\u043e \u0440\u044b\u043d\u043a\u0430 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438, \u0441\u0442\u0430\u043b\u0430 \u043b\u0438\u0434\u0435\u0440\u043e\u043c \u043f\u043e\u0432\u044b\u0448\u0435\u043d\u0438\u044f \u043d\u0430 \u0424\u0440\u0430\u043d\u043a\u0444\u0443\u0440\u0442\u0441\u043a\u043e\u0439 \u0444\u043e\u043d\u0434\u043e\u0432\u043e\u0439 \u0431\u0438\u0440\u0436\u0435 \u0432 \u0441\u0440\u0435\u0434\u0443. \u0418\u043d\u0432\u0435\u0441\u0442\u043e\u0440\u044b \u043e\u0434\u043e\u0431\u0440\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u043e\u0442\u0440\u0435\u0430\u0433\u0438\u0440\u043e\u0432\u0430\u043b\u0438 \u043d\u0430 \u043e\u0442\u0441\u0442\u0430\u0432\u043a\u0443 \u0433\u043b\u0430\u0432\u043d\u043e\u0433\u043e \u0438\u0441\u043f\u043e\u043b\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0430 \u0417\u043e\u043c\u043c\u0435\u0440\u0430 (Ron Sommer).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2002_%D0%B3%D0%BE%D0%B4\" title=\"2002 \u0433\u043e\u0434\">2002<\/a>&#160;\u2014 \u0412 \u0441\u0435\u0432\u0435\u0440\u043e-\u0437\u0430\u043f\u0430\u0434\u043d\u043e\u0439 \u043a\u0438\u0442\u0430\u0439\u0441\u043a\u043e\u0439 \u043f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u0438 \u0413\u0430\u043d\u044c\u0441\u0443 \u0430\u0440\u0445\u0435\u043e\u043b\u043e\u0433\u0438 \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0438\u043b\u0438 \u0433\u0438\u0433\u0430\u043d\u0442\u0441\u043a\u0443\u044e \u0441\u0435\u0442\u044c \u043f\u0435\u0449\u0435\u0440. \u041e\u043d\u0430 \u043f\u0440\u043e\u0442\u044f\u043d\u0443\u043b\u0430\u0441\u044c \u043d\u0430 \u0440\u0430\u0441\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u0431\u043e\u043b\u0435\u0435 50 \u043a\u0438\u043b\u043e\u043c\u0435\u0442\u0440\u043e\u0432 \u0441\u0440\u0435\u0434\u0438 \u043e\u0442\u0432\u0435\u0441\u043d\u044b\u0445 \u0441\u043a\u0430\u043b \u043f\u043e \u043e\u0431\u0435 \u0441\u0442\u043e\u0440\u043e\u043d\u044b \u0440\u0435\u043a\u0438 \u0426\u0437\u0438\u043d\u0445\u044d \u0438 \u043d\u0430\u0441\u0447\u0438\u0442\u044b\u0432\u0430\u0435\u0442 512 \u043f\u0435\u0449\u0435\u0440 \u0438 5 \u043a\u043e\u043b\u043e\u0434\u0446\u0435\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2002_%D0%B3%D0%BE%D0%B4\" title=\"2002 \u0433\u043e\u0434\">2002<\/a>&#160;\u2014 \u041f\u043e\u043f\u0443\u043b\u044f\u0440\u043d\u044b\u0439 \u0432 \u0441\u0432\u043e\u0451 \u0432\u0440\u0435\u043c\u044f \u0441\u0430\u0439\u0442 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%81%D1%82%D0%B8.%D1%80%D1%83\" title=\"\u0412\u0435\u0441\u0442\u0438.\u0440\u0443\">\u0412\u0435\u0441\u0442\u0438.\u0440\u0443<\/a>\u00bb \u043f\u0440\u0435\u043a\u0440\u0430\u0442\u0438\u043b \u0441\u0432\u043e\u0451 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u0435, \u0438 \u0442\u0435\u043f\u0435\u0440\u044c \u0434\u043e\u043c\u0435\u043d vesti.ru \u043f\u0435\u0440\u0435\u0448\u0451\u043b \u043a \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u0435 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%81%D1%82%D0%B8_(%D0%BF%D1%80%D0%BE%D0%B3%D1%80%D0%B0%D0%BC%D0%BC%D0%B0)\" class=\"mw-redirect\" title=\"\u0412\u0435\u0441\u0442\u0438 (\u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u0430)\">\u0412\u0435\u0441\u0442\u0438<\/a>\u00bb \u043a\u0430\u043d\u0430\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%A2%D0%A0\" class=\"mw-redirect\" title=\"\u0420\u0422\u0420\">\u0420\u0422\u0420<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2012_%D0%B3%D0%BE%D0%B4\" title=\"2012 \u0433\u043e\u0434\">2012<\/a>&#160;\u2014 \u0412 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0440\u0430\u0437\u043c\u044b\u0432\u0430 \u0435\u0441\u0442\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u043d\u0430\u0441\u044b\u043f\u0438 \u043f\u0440\u0435\u043a\u0440\u0430\u0442\u0438\u043b\u043e \u0441\u0432\u043e\u0451 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%B0%D1%88%D0%B5%D0%B9_(%D0%BE%D0%B7%D0%B5%D1%80%D0%BE)\" title=\"\u041c\u0430\u0430\u0448\u0435\u0439 (\u043e\u0437\u0435\u0440\u043e)\">\u041c\u0430\u0430\u0448\u0435\u0439\u0441\u043a\u043e\u0435 \u043e\u0437\u0435\u0440\u043e<\/a> .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2014_%D0%B3%D0%BE%D0%B4\" title=\"2014 \u0433\u043e\u0434\">2014<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_Boeing_777_%D0%B2_%D0%94%D0%BE%D0%BD%D0%B5%D1%86%D0%BA%D0%BE%D0%B9_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D0%B8\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 Boeing 777 \u0432 \u0414\u043e\u043d\u0435\u0446\u043a\u043e\u0439 \u043e\u0431\u043b\u0430\u0441\u0442\u0438\">\u041a\u0440\u0443\u0448\u0435\u043d\u0438\u0435 \u0411\u043e\u0438\u043d\u0433\u0430 777<\/a> (\u0410\u043c\u0441\u0442\u0435\u0440\u0434\u0430\u043c&#160;\u2014 \u041a\u0443\u0430\u043b\u0430-\u041b\u0443\u043c\u043f\u0443\u0440), \u0447\u0442\u043e \u043f\u0440\u0438\u0432\u0435\u043b\u043e \u043a \u0441\u043c\u0435\u0440\u0442\u0438 298 \u043b\u044e\u0434\u0435\u0439, \u043f\u0440\u0438\u0447\u0438\u043d\u0430 \u0432\u044b\u044f\u0441\u043d\u044f\u0435\u0442\u0441\u044f.<\/li><\/ul><h2>"}